import React from 'react';
import { Link } from 'react-router-dom';
import '../css/Home.css';
// import heroImage from '../images/hero.jpg'; // Large Portrait
// import dsaImage from '../images/dsa.jpg'; // DSA section Image

function Home() {
  return (
    <div className="home-container">
      {/* Full-Width Background with "DSA" */}
      <div className="dsa-background">
        <h1 className="dsa-bg-text">DSA</h1>
        <div className="dsa-overlay-text">
          <h2>Master Data Structures & Algorithms</h2>
          <p>Optimize your problem-solving skills and ace coding interviews!</p>
        </div>
      </div>

      {/* DSA Section */}
      <div className="dsa-section">
        <h2>Why Learn DSA?</h2>
        <p>
          Data Structures and Algorithms (DSA) are the foundation of efficient programming. 
          Mastering DSA helps in optimizing code, improving problem-solving skills, and excelling in technical interviews.
        </p>
        <Link to="/Latest-Blogs" className="explore-btn">Explore Latest Blogs</Link>
      </div>
    </div>
  );
}

export default Home;
